import React from "react";
import Layout from "../../components/layout";

const HomePage = () => {
  return (
    <Box display="flex" width="100%">
      <Sidebar />
      <div style={{ width: "100%" }}>
        <Header />
        HomePage <Footer />
      </div>
    </Box>
  );
};

export default HomePage;
